import Recommended from "../recommended/Recommended";
import "./../../App.css";
import CategoryNavbar from "../navbar/CategoryNavbar";

const Layout = () => {
  return (
    <div style={{ display: "flex", flexDirection: "column" }}>
      <Navbar />
      {/* <CategoryNavbar /> */}
      <div
        style={{
          paddingBottom: "200px",
          display: "flex",
          flexDirection: "column",
          alignItems: "center",
        }}
      >
        <Promotions />
        <Announcement />
        <Recommended />
        <Products />
      </div>
    </div>
  );
};

export default Layout;
